% c1 m1 m2 r1 r2 r3 sB sC sD bV bV800 VA fN fR fSS f t s tM sM
c1    = C(index,1);
m1    = C(index,2);
m2    = C(index,3);
r1    = C(index,4);
r2    = C(index,5);
r3    = C(index,6);
sB    = C(index,7);
sC    = C(index,8);
sD    = C(index,9);
bV    = C(index,10);
bV800 = C(index,11);
VA    = C(index,12);
fN    = C(index,13);
fRc    = C(index,14);
fSS   = C(index,15);
phi   = C(index,16);
tau   = C(index,17);


fM   = c1 + m1*M + m2*M.^2;
fR   = (r1+r2*M).*log10(R+r3);

switch Vs30form
    case 1,fS = sB*SB+sC*SC+sD*SD;      %Eq(5)
    case 2,fS = bV*log10(Vs30/VA);      %Eq(6)
    case 3,fS = bV800*log10(Vs30/800);  %Eq(7)
end

fSOF   = fN*FN + fRc*FR + fSS*FSS;   % Eq(8)
if iTo==0
    log10y = fM + fR + fS + fSOF + log10(4*pi^2/To^2);
elseif iTo==2
    log10y = fM + fR + fS + fSOF;
end

sigma  = sqrt(phi^2+tau^2);



